  namespace: System.Net.Http.Headers
  summary: "\n<p>Represents a string header value with an optional quality.</p>\n"
  remarks: "\n<p>The <xref href=\"System.Net.Http.Headers.StringWithQualityHeaderValue\" data-throw-if-not-resolved=\"false\"></xref> class provides support for strings with a quality factor used in some headers as defined in <see href=\"http://go.microsoft.com/fwlink/?LinkID=241642\">RFC 2616</see> by the IETF. </p>\n<p>Quality factors allow the user agent to indicate the relative degree of preference for various options in various headers including the Accept, Accept-Charset, Accept-Encoding, and Accept-Language headers. Quality uses a scale from 0 to 1. The default value is q=1.</p>\n"
